Установка кессона при оборудовании скважины в Минске и области Кессон – это камера с люком, выполненная из пластика или из железобетона, используемая для защиты скважины от грунтовой воды, а также для удобства обслуживания насосной системы. Кроме того, установка кессона в Минске позволяет предотвратить загрязнение артезианской воды, так как дно скважины будет идеально герметичным. 
Виды кессонов, стоимость монтажа В зависимости от материала, кессон может быть пластиковым или металлическим. Несмотря на то, что кессон для скважин из металла имеет большую цену, для обустройства скважины на воду кессонами в Минской области чаще выбирается пластик. Это можно объяснить тем, что пластиковые кессоны имеют больший срок службы. 
Кроме того кессоны могут отличаться по размеру, стандартные габариты: 
Высота – 1500 мм; 
Диаметр корпуса– 1000 мм; 
Диаметр горловины — не менее 650 мм; 
Высота горловины кессона –500 мм; 
